import "../styles/components/MyButton.css";

function MyButton(props) {
  const title = props.title;
  const icon = props.icon;
  return (
    <div>
      <button className="Bouton">
        <i>{icon}</i>
        <h3>{title}</h3>
      </button>
    </div>
  );
}

export default MyButton;
